import React, { Component } from "react";
import "./App.css";

class About extends Component {
  render() {
    return (
      <div className="Intro">
        {" "}
        <div className="about">
          {" "}
          I like reading stuff about the{" "}
          <a className="underline--magical ">Web Development</a> industry, and
          am curious about anything related it. Although I am currently learning
          the core computer science/software engineering topics at McGill, most
          of the web-dev related skills that I have achieved are{" "}
          <a className="underline--magical ">self-taught</a>. I love the Web and
          I want to be able to contribute to it, which is why I hope to get an{" "}
          <a className="underline--magical ">internship</a> or a part-time
          position in front-end related positions :){" "}
        </div>
      </div>
    );
  }
}

export default About;
